contracts/ARCSubscription.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract ARCSubscription is ReentrancyGuard, Pausable, Ownable {
    IERC20 public usdc;
    IERC20 public usdt;

    enum TokenType { USDC, USDT, ETH }

    struct Subscription {
        address farmer;
        string culture;
        uint256 surfaceHa;
        uint256 riskIndex;
        uint256 pricePerKg;
        uint256 payoutCap;
        uint256 timestamp;
        bool isPaid;
    }

    uint256 public subscriptionCount;
    mapping(uint256 => Subscription) public subscriptions;

    event Subscribed(
        uint256 indexed id,
        address indexed farmer,
        string culture,
        uint256 surfaceHa,
        uint256 riskIndex,
        uint256 pricePerKg,
        uint256 payoutCap,
        TokenType token
    );

    constructor(address _usdc, address _usdt) {
        usdc = IERC20(_usdc);
        usdt = IERC20(_usdt);
    }

    function subscribeUSDC(
        string calldata culture,
        uint256 surfaceHa,
        uint256 riskIndex,
        uint256 pricePerKg,
        uint256 payoutCap,
        uint256 amount
    ) external whenNotPaused nonReentrant {
        require(usdc.transferFrom(msg.sender, address(this), amount), "Transfer failed");
        _registerSubscription(culture, surfaceHa, riskIndex, pricePerKg, payoutCap, TokenType.USDC);
    }

    function subscribeUSDT(
        string calldata culture,
        uint256 surfaceHa,
        uint256 riskIndex,
        uint256 pricePerKg,
        uint256 payoutCap,
        uint256 amount
    ) external whenNotPaused nonReentrant {
        require(usdt.transferFrom(msg.sender, address(this), amount), "Transfer failed");
        _registerSubscription(culture, surfaceHa, riskIndex, pricePerKg, payoutCap, TokenType.USDT);
    }

    function subscribeETH(
        string calldata culture,
        uint256 surfaceHa,
        uint256 riskIndex,
        uint256 pricePerKg,
        uint256 payoutCap
    ) external payable whenNotPaused nonReentrant {
        require(msg.value > 0, "ETH amount required");
        _registerSubscription(culture, surfaceHa, riskIndex, pricePerKg, payoutCap, TokenType.ETH);
    }

    function _registerSubscription(
        string memory culture,
        uint256 surfaceHa,
        uint256 riskIndex,
        uint256 pricePerKg,
        uint256 payoutCap,
        TokenType token
    ) internal {
        subscriptions[subscriptionCount] = Subscription({
            farmer: msg.sender,
            culture: culture,
            surfaceHa: surfaceHa,
            riskIndex: riskIndex,
            pricePerKg: pricePerKg,
            payoutCap: payoutCap,
            timestamp: block.timestamp,
            isPaid: false
        });

        emit Subscribed(subscriptionCount, msg.sender, culture, surfaceHa, riskIndex, pricePerKg, payoutCap, token);
        subscriptionCount++;
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }

    function withdrawETH() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    function withdrawTokens(IERC20 token) external onlyOwner {
        token.transfer(owner(), token.balanceOf(address(this)));
    }
}

